var videos = [];

function setup() {
    var add = button = createButton("增加");
    add.position(240, 20);
    add.mousePressed(addEvent);
    var index = 0;
    function addEvent() {
        index++;
        createVideoInput(index, 10, 50 + 150 * (index - 1), "素材");
    }
    var button2 = createButton("合成");
    button2.position(300, 20);
    button2.mousePressed(buttonEvent2);
    function buttonEvent2() {
        //alert(JSON.stringify(videos,null,2))
        var videosNew = Array.from(videos, v => {
            if (v && v.url) {
                return {
                    url: v.url,
                    text: v.text,
                    type: v.type,
                    textImage: Lab.base.createTextImage(v.text, 120, "red")
                }
            }
        }).filter(f => f);
        //alert(JSON.stringify(videos,null,2))
        Lab.video.createShortVideoFromLocal(videosNew).then(()=>alert('完成'));
    }

