function createVideoInput(index, x, y, displayText) {
    videos[index] = {
        url: null,
        text: null,
        type: null
    };
    var button = createButton(displayText);
    button.position(x, y);
    button.mousePressed(buttonEvent);

    function buttonEvent() {
        var labVideo = Lab.video.createShortVideoInput();
        if (labVideo) {
            videos[index].url = labVideo.url;
            videos[index].type = labVideo.type;
            if (labVideo.type == "video") {
                var vid = createVideo(labVideo.url, vidLoad);
                vid.size(100, 100);
                vid.position(x + 100, y);

                function vidLoad() {
                    vid.loop();
                    //vid.pause();
                    vid.volume(0.8);
                }
            };
            if (labVideo.type == "img") {
                var vid = createVideo(labVideo.url);
                vid.size(100, 100);
                vid.position(x + 100, y);
                vid.attribute('poster', labVideo.url);
            };
            if (labVideo.type == "audio") {

                var ele = createAudio(labVideo.url);
                //ele.autoplay(false);
                var abtn = createButton("音频-点击播放");
                abtn.position(x + 100, y + 50);
                abtn.mousePressed(buttonEvent3);
                function buttonEvent3() {
                    //
                    ele.play(true);
                }
            };

            if (labVideo.type != "audio") {
                let inp = createInput('');
                inp.input(myInputEvent);
                inp.position(x, y + 120);

                function myInputEvent() {
                    videos[index].text = (this.value()).trim();
                }
            }

        }
    }
}
